import React from 'react';
import '../styles/Header.css';

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <h1>Kastamonu Üniversitesi</h1>
        <h2>Yemekhane Menüsü</h2>
      </div>
    </header>
  );
}

export default Header;
